script: |
  super -f text -I q6546.spq | sort > q6546.out

inputs:
  - name: q6546.spq
    data: |
      SELECT - col1 + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT IN ( - + col2 - + + col1 * - 41, - col1, - col1 + col2 + - col1 );
  - name: tab0

outputs:
  - name: q6546.out
    data: |
